import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import Button from "react-bootstrap/Button";
import { useEffect, useState } from "react";

const Dish = () => {
  const [records, setRecords] = useState([]);

  useEffect(() => {
    fetch("www.themealdb.com/api/json/v1/1/search.php?f=a")
      .then((response) => response.json())
      .then((data) => setRecords(data))
      .catch((err) => console.log(err));
  }, []);

  return (
    <>
      {records.map((list, index) => (
        <Card key={index} style={{ width: "18rem" }}>
          <Card.Img
            variant="top"
            src={list.strMealThumb}
          />
          <Card.Body>
            <Card.Title>{list.strMeal}</Card.Title>
            <Card.Text>address</Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroup.Item>Comment 1</ListGroup.Item>
            <ListGroup.Item>Comment 2</ListGroup.Item>
            <ListGroup.Item>Comment 3</ListGroup.Item>
          </ListGroup>
          <Card.Body>
            <Button variant="success">Comment</Button>
            <Button variant="success">Save</Button>
          </Card.Body>
        </Card>
      ))}
    </>
  );
};

export default Dish;
